					"rating": 69,
					"id": "434228236734415_574989119324992",
					"groupName": "השבוע: שאלות ותשובות על סטארטאפים",
					"personName": "Roee Mor",
					"message": "שלום חברים, \nרציתי לפתוח דיון בנושא Growth Hacking, ולהציע עזרה בנושא לכל יזם בקבוצה שיהיה מעוניין לספר על המוצר שלו/ה, קהל היעד, אסטרטגיית הצמיחה הנוכחית, וכל פרט שיכול לעזור במציאת פתרונות יצירתיים לצמיחה.\nכשאני אומר יצירתיים אני מתכוון ליצירתיים! (זה לא עוד דיון בנושא SEO/SEM/PPC וכו'). \nבמיוחד מעניינים סטארטאפים בתחילת דרכם, עם גרסה ראשונית של מוצר ותקציב אפסי לשיווק, שמעוניינים להתחיל לייצר טראפיק ומשתמשים. \n\nמה זה Growth Hacking יצירתי?\nאחד מסיפורי הההצלחה החזקים ביותר בתחום הוא של AIRBNB (ואני ממליץ למי שלא מכיר את הסיפור לקרוא את זה - www.growthhackers.com/growth-studies/airbnb). \n \nאיך אני יכול לעזור? \nבתקופה שבה AIRBNB הוקמה (ומספר שנים לפני שהומצא המונח Growth Hacking), המוצר שעבדתי עליו כ-PM חצה את רף ה-100 מיליון משתמשים/התקנות.\nמספר שנים קודם הצטרפתי לחברה, כשלרשותינו היו: \nמוצר בפיתוח, אפס משתמשים, ואפס דולרים להוציא על פרסום. (אה כן, וארבעה אנשים יצירתיים במיוחד!). במצב כזה חייבים לחשוב מחוץ לקופסה, חייבים למצוא דרכים לייצר טראפיק תוך \"רכיבה\" על פלטפורמות מוצלחות אחרות (כן, גם אם זה לא הכי אתי...), וחייבים להגיע להבנה עמוקה מאוד של המשתמשים הקיימים כדי לגרום לויראליות וסטיקינס. בדיוק בתחומים האלה אוכל לעזור.\n \nהמילה היחידה שאני יכול לחשוב עליה כדי לתאר את מה שקרה בין-0 ל-100 מיליון משתמשים היא: ט-ר-פ-ת ! ומאז אני מכור... :) \n\nמי מתנדב להיות ראשון?",
