					"personName": "Alon Osman",
					"message": "היי כולם,\nאני שותף ליצירת הספרדשיט הזה שמאחד את הכלים השימושיים ביותר למעצבי UX ולמנהלי מוצר.\nהלינק פתוח לכל. אם ברצונכם לתרום לשיתוף המידע, תרגישו חופשיים להפיץ ולשנות ככל העולה על רוחכם וכמובן להוסיף כלים חדשים. \n\nhttps://docs.google.com/spreadsheets/d/1FxOqoQYhViyy00zaC2ASGbv9imB67K7-qpv7NNTgfuM/edit#gid=139089350\n\nתהנו (טרפת)",
