									"message": "הי מאיר, אני חושב שכבר קיימים כמה מסמכים כאלה. יש את. SAFE של YC (הנפקת הון עתידית לאנג'לים) ואת KISS של 500 startups (הלוואה המירה). ל YC יש גם מסמך שמיועד לסבב A אבל יכול לשמש גם כבסיס לסיד אם מנפיקים בו הון. אני מניח שיש עוד פורמטים טובים ברחבי הרשת. \nבכל אופן, אתה לא חושב ששווה לעשות את השלב הזה בליווי עורך דין טוב?",
