						"message": "שלום, \nלפני כשנה עלה לי רעיון לאפליקציה.\nנפגשתי עם מספר פרילנסרים וחברה אחת בניסיון לתמכר את כתיבת הקוד .\nלאחר שקבלתי הצעות שנעו בין 30000-150000 הבנתי שעדיף לי לחפש חברים/מוכרים שאולי יתעניינו באפליקציה ויכתבו קוד עבורי - גם זה לא צלח.\n\nלכן לפני כארבע חודשים קניתי מחשב מק, ולאחר קריאת חומר ברשת,סרטים ביוטיוב וקורס לפיתוח אפליקציה ב- udemy 25$ .\nבניתי את האפליקציה בעצמי,שילמתי 99$ נוספים לאפל וכרגע האפליקציה נמצאת בשלב אישור בחנות אפל (לאחר דחיה ראשונה על הגדרת גיל לא מתאימה )\n\nמה צעד הבא שאלי לעשות ?\n- לשווק ?\n- לגייס כסף לצורך שיפור / בניית אפליקציה גם לאנדרואיד ?\n- לבדוק האם ראיון שלי טוב ? (לבצע סקר בפייסבוק)\n\nאשמח להצעות בנושא.\nתודה רבה !",
