									"from": {
										"name": "Or Azulay",
										"id": "10208843575060402"
									},
									"message": "1. לשווק ברשתות חברתיות בהתאם לקהל היעד שלך, לפנות לבלוגרים ספציפיים שיכתבו על המוצר. \n2. להגיע לכמות יוזרים מספיקה לבדיקות (נגיד 1000), ולבדוק איך היוזרים משתמשים באפליקציה, איפה הם מפסיקים, נתקעים ומתי.\n3. לשפר לשפר לשפר - בהתאם לנתונים שאספת בשלב 2.\n\nברגע שתגיע לגדילה אקספוננציאלית של יוזרים בכל חודש (15% אפריל, 30% מאי, 60% יוני) אז זה הזמן לגייס.",
