									"message": "https://docs.google.com/spreadsheets/d/1zuSO8fMBcju5S-ZfDh3ffajnn2U2eau40CbtBnp4ubA/pubhtml#\n\nיש כאן רשימות של אקסלרטורים בישראל ואנגלים תוכל להיעזר בזה. \nבהצלחה וכל הכבוד!",
