									"message": "לא הבנתי.. כתבת את כל העולם ולא הוצאת את האפליקציה לאיש אחד בעולם.. אתה מחביא? שים פה לינק.. עזוב סיפורים. תן גזזזזזז.. מתחיל בחמישי ומשם מאיץ.. כל פיד לינק כל שיחה כל נשימה היא שווק... מחכים ללינק לתת פידבק ולהפיץ.. וגם אם לא עלה תו לנו מסכים. תן הסבר.. שווק לנו.. הנה השעור הראשון בשיווק.. מבלי לשלם 500 דולר לעוד קורס..",
