									"message": "רון, לבקשתך אשלח בקרוב מספר מסכים והסבר כפי שיופיע בחנות אפל אחרי שיאשרו ...\nלגבי הקישור... מכיוון שהאפליקציה נמצאת בשלב test אני יכול לשלוח אותה רק לאנשים אותם אני מגדיר לפי המייל שלהם...\nלכל מי שרוצה לראות , מוזמן לשלוח לי בפרטי את הכתובת אימייל שלו.\n(כרגע זה רק לאייפון)",
