					"groupName": "השבוע: שאלות ותשובות על סטארטאפים",
					"personName": "Izhar Shay",
					"message": "שלום חברים. חומר למחשבה בסוף השבוע המתקרב. ראיתי לאחרונה הרבה סטארט-אפים צעירים בתחילת דרכם, חלקם גם מתייעצים איתי, שמתחבטים בין מספר אפשרויות מימון על יד משקיעים. אנחנו בתקופה טובה יחסית, יש די הרבה כסף בשוק שזמין להשקעות, ולכן שאלת מהי האלטרנטיבה הנכונה עולה יותר בתכיפות. \nבכל פעם מחדש אני מופתע לראות עד כמה הוולואציה היא גורם מרכזי בשיקולים. מציע לכם בחום לחשוב גם על התמונה הכללית - עם מי אתם רוצים לעשות עסקים, האם אלה הם השותפים איתם תרצו לעבוד צמוד בעשר שנים הקרובות, האם כל השאר התנאים - מעבר להערכת שווי ודילולים - מקובלים עליכם ועוד ועוד. \nאם תרצו לשאול בנושא אתם מוזמנים. ובכל מקרה, שבת שלום, תנוחו קצת.",
